import React, { Fragment, useState } from "react";
import img from "../../Image/image.jpg";
import google from "../../Image/google.svg";
import { DemoContainer } from "@mui/x-date-pickers/internals/demo";
import { AdapterDayjs } from "@mui/x-date-pickers/AdapterDayjs";
import { LocalizationProvider } from "@mui/x-date-pickers/LocalizationProvider";
import { DatePicker } from "@mui/x-date-pickers/DatePicker";

const Sign = () => {
  const [formData, setFormData] = useState({
    email: "",
    name: "",
    birthDate: {},
    address: "",
    phone: "",
    password: "",
  });

  const handleDateChange = (newValue) => {
    setFormData((prev) => ({ ...prev, birthDate: newValue }));
  };

  const handleChange = (event) => {
    const { name, value } = event.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  console.log(formData);
  return (
    <Fragment>
      <div className="flex items-center justify-center min-h-screen bg-gray-100">
        <div className="relative flex flex-col m-6 space-y-8 bg-white shadow-2xl rounded-2xl md:flex-row md:space-y-0">
          <div className="flex flex-col justify-center p-8 md:p-10">
            <div className="lg:w-[500px] lg:flex inline pb-1">
              <p className="font-bold duration-700 sm:text-4xl text-3xl sm:mr-3">
                Create account
              </p>
            </div>
            <span className="font-light text-gray-400 mb-5">
              Welcom back! Please enter your details
            </span>
            <div className="py-2">
              <span className="mb-2 text-md">Email</span>
              <input
                type="text"
                className="w-full p-2 border border-gray-300 rounded-md placeholder:font-light placeholder:text-gray-500"
                name="email"
                id="email"
                value={formData.email}
                onChange={handleChange}
              />
            </div>
            <div className="py-2">
              <span className="mb-2 text-md">Name</span>
              <input
                type="text"
                className="w-full p-2 border border-gray-300 rounded-md placeholder:font-light placeholder:text-gray-500"
                name="name"
                id="name"
                value={formData.name}
                onChange={handleChange}
              />
            </div>
            <div className="py-2 w-full">
              <span className="mb-2 text-md">Date</span>
              <LocalizationProvider dateAdapter={AdapterDayjs}>
                <DemoContainer
                  sx={{
                    padding: 0,
                  }}
                  components={["DatePicker"]}
                >
                  <DatePicker
                    // value={formData.birthDate}
                    onChange={handleDateChange}
                    sx={{
                      flex: 1,

                      "& .MuiInputBase-input": {
                        padding: "9px",
                        color: "#333",
                      },
                      "& .MuiIconButton-root": {
                        color: "#999",
                      },
                    }}
                  />
                </DemoContainer>
              </LocalizationProvider>
            </div>
            <div className="py-2">
              <span className="mb-2 text-md">Address</span>
              <input
                type="text"
                className="w-full p-2 border border-gray-300 rounded-md placeholder:font-light placeholder:text-gray-500"
                name="address"
                id="address"
                value={formData.address}
                onChange={handleChange}
              />
            </div>
            <div className="py-2">
              <span className="mb-2 text-md">Phone</span>
              <input
                type="text"
                className="w-full p-2 border border-gray-300 rounded-md placeholder:font-light placeholder:text-gray-500"
                name="phone"
                id="phone"
                value={formData.phone}
                onChange={handleChange}
              />
            </div>
            <div className="py-2">
              <span className="mb-2 text-md">Password</span>
              <input
                type="password"
                name="pass"
                id="pass"
                className="w-full p-2 border border-gray-300 rounded-md placeholder:font-light placeholder:text-gray-500"
              />
            </div>
            <button className="w-full bg-black text-white p-2 rounded-lg mb-6 hover:bg-white hover:text-black border hover:border-gray-300">
              Create
            </button>
            <button className="w-full border border-gray-300 text-md p-2 rounded-lg mb-6 hover:bg-black hover:text-white">
              <img src={google} alt="img" className="w-6 h-6 inline mr-2" />
              Create with Google
            </button>
          </div>
          <div className="relative">
            <img
              src={img}
              alt={img}
              className="w-[400px] h-full hidden rounded-r-2xl md:block object-cover"
            />
            <div className="absolute hidden bottom-10 right-6 p-6 bg-violet-300 bg-opacity-30 backdrop-blur-sm rounded drop-shadow-lg md:block">
              <span className="text-white text-xl">
                We've been uesing Untitle to kick"
                <br />
                start every new project and can't <br />
                imagine working without it."
              </span>
            </div>
          </div>
        </div>
      </div>
    </Fragment>
  );
};

export default Sign;
